p&gt;You (or someone pretending to be you) requested a password reset of your account.&lt;/p&gt;&lt;p&gt;If you access the following link your password will be changed to: &lt;strong&gt;$newPassword&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;$newPasswordLink&quot;&gt;$newPasswordLink&lt;/a&gt;&lt;/p&gt;',1),(51,57,'Your pre-paid balance is below Water mark.',0),(52,58,'Dear $userSalutation,\\r\\n\\r\\nYour Pre-paid balance has reached below the threshold mark of $thresholdAmt. Your balance is currently at $dynamicBalance.\\r\\n\\r\\nTherefore, you are kindly advised to make sufficient payment into your account as early as possible.\\r\\n\\r\\nThanks.',0),(53,60,'Usage pool consumption status.',0),(54,61,'Dear $userSalutation,\\r\\n\\r\\nYou have used $percentageConsumption% from Free Usage Pool - $usagePoolName.\\r\\n\\r\\nThanks.',0),(55,63,'Usage pool consumption status.',1),(56,64,'Usage pool consumption status.',1),(57,65,'Dear $userSalutation, You have used $percentageConsumption% from Free Usage Pool - $usagePoolName. Thanks.',1),(58,66,'Dear $userSalutation, You have used $percentageConsumption% from Free Usage Pool - $usagePoolName. Thanks.',1),(59,67,'Dear $userSalutation,<p>You have used $percentageConsumption% from Free Usage Pool - $usagePoolName.<p>Thanks.',1),(60,68,'Dear $userSalutation,<p>You have used $percentageConsumption% from Free Usage Pool - $usagePoolName.<p>Thanks.',1),(61,69,'Billing Statement from $company_name',0),(62,NULL,'Dear $first_name $last_name,\n\n This is to notify you that your latest invoice (number $number) is now available. The total amount due is: $total. You can view it by login in to:\n\n\" + Util.getSysProp(\"url\") + \"/billing/user/login.jsp?entityId=$company_id\n\nFor security reasons, your statement is password protected.\nTo login in, you will need your user name: $username and your account password: $password\n \n After logging in, please click on the menu option  List, to see all your invoices.  You can also see your payment history, your current purchase orders, as well as update your payment information and submit online payments.\n\n\nThank you for choosing $company_name, we appreciate your business,\n\nBilling Department\n$company_name',0),(63,NULL,'Dear $first_name $last_name,\n\n  This email is to notify you that we have received your latest payment and your account no longer has an overdue balance.\n\n  Thank you for keeping your account up to date,\n\n\nBilling Department\n$company_name',0),(64,72,'You account is now up to date',0),(65,NULL,'Dear $first_name $last_name,\n\nOur records show that you have an overdue balance on your account. Please submit a payment as soon as possible.\n\nBest regards,\n\nBilling Department\n$company_name',0),(66,74,'Overdue Balance',0),(67,75,'Your service from $company_name is about to expire',0),(68,NULL,'Dear $first_name $last_name,\n\nYour service with us will expire on $period_end. Please make sure to contact customer service for a renewal.\n\nRegards,\n\nBilling Department\n$company_name',0),(69,NULL,'Dear $first_name $last_name\n\n   We have received your payment made with $method for a total of $total.\n\n   Thank you, we appreciate your business,\n\nBilling Department\n$company_name',0),(70,78,'Thank you for your payment',0),(71,79,'Payment failed',0),(72,NULL,'Dear $first_name $last_name\n\n   We have received your payment made with $method for a total of $total.\n\n   Thank you, we appreciate your business,\n\nBilling Department\n$company_name',0),(73,NULL,'Dear $first_name $last_name\n\n   We have received your payment made with $method for a total of $total.\n\n   Thank you, we appreciate your business,\n\nBilling Department\n$company_name',0),(74,82,'Invoice remainder',0),(75,NULL,'Dear $first_name $last_name,\n\nWe want to remind you that the credit card that we have in our records for your account is about to expire. Its expiration date is $expiry_date.\n\nUpdating your credit card is easy. Just login into \" + Util.getSysProp(\"url\") + \"/billing/user/login.jsp?entityId=$company_id. using your user name: $username and password: $password. After logging in, click on \'Account\' and then \'Edit Credit Card\'. \nThank you for keeping your account up to date.\n\nBilling Department\n$company_name',0),(76,84,'It is time to update your credit card',0),(77,85,'Your pre-paid balance is below Water mark.',0),(78,86,'Dear $userSalutation,\\r\\n\\r\\nYour Pre-paid balance has reached below the credit limitation 1 mark of $creditNotificationLimit. Your balance is currently at $dynamicBalance.\\r\\n\\r\\nTherefore, you are kindly advised to make sufficient payment into your account as early as possible.\\r\\n\\r\\nThanks.',0),(79,88,'Your pre-paid balance is below Water mark.',0),(80,89,'Dear $userSalutation,\\r\\n\\r\\nYour Pre-paid balance has reached below the credit limitation 2 mark of $creditNotificationLimit. Your balance is currently at $dynamicBalance.\\r\\n\\r\\nTherefore, you are kindly advised to make sufficient payment into your account as early as possible.\\r\\n\\r\\nThanks.',0),(81,91,'Your registration credentials',0),(82,92,'Hello  $first_name $last_name,\\r\\n\\r\\nWelcome to JBilling!.\\r\\n\\r\\nPlease follow this link to set your credentials:\\r\\n\\r\\n$newPasswordLink',0);
